import {useState, useEffect } from "react";

const Myhome = () =>{
    let[allproduct, updateproduct] = useState([]);

    const getProduct = () =>{
        fetch("")
        .then(response => response.json())
        .then(productarray => {
           updateproduct(productarray);
        })
    }

    useEffect(() =>{
      getProduct();
    }, [1])

    return(
        <section>
            <div id="banner"> </div>
            <div className="container mt-4">
                
            </div>
        </section>
    )
}
export default Myhome;
